import React from "react";
import { connect } from "react-redux";
import Radio from "./SingleRadio";
import { getRadiosByVisibilityFilter } from "../../selectors";
// import { getTodos } from "../redux/selectors";

const RadioList = ({ radio }) => (
  <ul className="radio-list">
    {radios && radios.length
      ? radios.map((radio, index) => {
          return <Radio key={`todo-${radio.id}`} radio={radio} />;
        })
      : "No radio, yay!"}
  </ul>
);

const mapStateToProps = state => {
    const { visibilityFilter } = state;
    const radios = getRadiosByVisibilityFilter(state, visibilityFilter);
    return { radios };
};

export default connect(mapStateToProps)(RadioList);
